import React from 'react';
import NavigationBar from './NavigationBar';
import './AboutUs.css';

const AboutUs = () => {
  return (
    <>
      <NavigationBar />
      <div className="aboutus-wrapper">

        {/* Intro Section */}
        <section className="intro-banner">
          <h1 className="intro-title">About Advanced To-Do</h1>
          <p className="intro-tagline">
            Redefining task management with innovation, precision, and elegance.
          </p>
        </section>

        {/* Mission Statement */}
        <section className="mission-block">
          <div className="mission-text">
            <h2>Who We Are</h2>
            <p>
              Founded in 2023, we aim to revolutionize productivity by delivering intuitive, smart, and scalable task management solutions. Whether you're an individual or part of a large team, our tools are designed to fit your lifestyle and workflow.
            </p>
          </div>
          <div className="mission-image">
            <img src="https://media.istockphoto.com/id/1284038459/photo/im-sure-ill-have-all-the-boxes-checked-by-tonight.jpg?s=612x612&w=0&k=20&c=Ax0lmBiU67ZdkmDhlT5-NIgBtUCmtQngac9E7fFRWQo=" alt="About Us Visual" />
          </div>
        </section>

        {/* Core Features */}
        <section className="feature-display">
          <h2>Why Choose Us</h2>

        </section>
      </div>
    </>
  );
};

export default AboutUs;
